funcMain:
function funcMain() {
  log("funcMain");
  if (suffix == "iCoDiv=01") funcReserve();
  else funcOther();
}

funcOther:
  function funcOther() {
    log("funcOther");
    const tag = localStorage.getItem("TZ_MAIN");
    if (tag && new Date().getTime() - tag < 1000 * 5) {
      funcEnd();
      return;
    }
    localStorage.setItem("TZ_MAIN", new Date().getTime());

    location.href = "https://www.clubd.com/m_clubd/index.do?iCoDiv=01";
  }

funcReserve:
  function funcReserve() {
    log("funcReserve");
    const tag = localStorage.getItem("TZ_LOGOUT");
    if (tag && new Date().getTime() - tag < 1000 * 5) {
      funcEnd();
      return;
    }
    localStorage.setItem("TZ_LOGOUT", new Date().getTime());

    TZLOG(logParam, (data) => {
      log(data);
      onClickDay(fulldate);
      setTimeout(funcTime, 2000);
    });
  }

funcTime:
function funcTime() {
  log("funcTime");
  const els = window["time-grid"].getElementsByTagName("tr");
  let target;
  Array.from(els).forEach((el) => {
    const strParam = el.children[0].innerText;
    const elTime = strParam.replace(/[^0-9]/g, "");
    const elCourse = strParam.replace(/[^A-Z]/g, "");
    log(time == elTime, dictCourse[course] == elCourse);
    log(time, elTime, dictCourse[course], elCourse);
    if (time == elTime && dictCourse[course] == elCourse)
      target = el.children[0];
  });
  log("target", target);
  if (target) {
    target.click();
    funcExec();
  }
}

funcExec:
  function funcExec() {
    log("funcExec");
    const tag = localStorage.getItem("TZ_EXEC");
    if (tag && new Date().getTime() - tag < 1000 * 5) return;
    localStorage.setItem("TZ_EXEC", new Date().getTime());

    document
      .getElementsByClassName("btnBox4")[0]
      .getElementsByClassName("motion")[0];
    setTimeout(funcEnd, 1000);
  }

funcEnd:
function funcEnd() {
  log("funcEnd");
  const strEnd = "end of reserve/reserve";
  logParam.message = strEnd;
  TZLOG(logParam, (data) => {});
  const ac = window.AndroidController;
  if (ac) ac.message(strEnd);
  location.href = "/clubd/member/actionLogout.do";
}
